import '../styles/Sidebar.css';

class Sidebar extends Component{
  constructor(){
    super();
    this.state = {
      results: {}
    }
  }

  render() {
    return (
        <div className= "App-sidebar">
            <button className="collapsible">Browse</button>
              <div class="content">
                <p>Lorem ipsum...</p>
              </div>
            <button>Community</button>
            <button>Deveoper</button>
        </div>
    );
  }

};

export default Sidebar;
